import React from 'react';

function ImagesPage(props) {
  const { images } = props.location.state;

  return (
    <div>
      <h1>Images Page</h1>
      {images.map(data => (
        <img alt="All Images" width={100} height={100} src={data.image} key={data.id} />
      ))}
    </div>
  );
}

export default ImagesPage;
